################################# Compare two distributions using kS-test coupled with permutations:
############Test based on the maximum distace between empirical distributions
############# For cellFree condition we compare: UU vs. PP, UU vs. UP and UP vs. PP
X<- CardinalUUCellFree$X.MM # green
Y<- CardinalPPCellFree$X.MM
length(X)
length(Y)
#> length(X)
#[1] 18423
#> length(Y)
#[1] 38704

X<- CardinalUUCellFree$X.MM # blue
Y<- CardinalUPCellFree$X.MM
length(X)
length(Y)
#> length(X)
#[1] 18423
#> length(Y)
#[1] 53794

X<- CardinalUPCellFree$X.MM #red"
Y<- CardinalPPCellFree$X.MM
##> length(X)
#[1] 53794
#> length(Y)
#[1] 38704

#plot(X,Y)
Z <- c(X,Y)
n <- length(X)
m <- length(Y)
N <- length(Z)

# Number of permutations
K = 10000

# Test statistic
TS <- function(A,B) ks.test(A,B)$statistic

# Test statistic for the observed sample
TO <- TS(X,Y)

# Vector of test statistics for each permutation
Dks <- vector()

# Permutation test
for(i in 1:K){
  set.seed(i)
  Z.pi <- sample(Z, N, replace = FALSE)
  Dks[i] <- TS(Z.pi[1:n], Z.pi[(n+1):(n+m)])
  Dks[i]
}
Dks
TS(X,Y)
# Visualising the permuted test statistics
hist(Dks,xlim=c(0,0.8))

abline(v = TO, lwd = 2, col = "green") #"red")#"green""blue" 
TO
box()

# approximate p-value
mean(Dks>TO)
# Direct test using the Kolmogorov distribution
ks.test(X,Y)

